import { useEffect, useState } from "react";
// import "./styles.css";

export default function Test() {
  const [music, setMusic] = useState([]);

  useEffect(() => {
    const getData = () => {
      fetch("data.json", {
        headers: {
          "Content-Type": "application/json",
          Accept: "application/json"
        }
      })
        .then((response) => response.json())
        .then((data) => setMusic(data));
    };

    getData();
  }, []);

  return (
    <div className="App">
      <h1>Hello Tunji</h1>
      <h2>Artist</h2>
      {music.map((m) => (
        <div key={m.id}>
          <h2>{m.artistname}</h2>
          <h3>{m.album}</h3>
          <img src={m.albumImg} />
        </div>
      ))}
    </div>
  );
}
